import React, { Component } from "react";
import Pnav from "../Projects";
import Grim1 from "./Grimeton/1.png";
import Grim2 from "./Grimeton/2.png";
import Grim3 from "./Grimeton/3.png";
import Grim4 from "./Grimeton/4.png";
import Grim5 from "./Grimeton/5.png";
import Grim6 from "./Grimeton/6.png";
import Grim7 from "./Grimeton/7.png";
import Grim8 from "./Grimeton/8.png";
import Grim9 from "./Grimeton/9.png";
import Grim10 from "./Grimeton/10.png";

const imgArr = [
  Grim1,
  Grim2,
  Grim3,
  Grim4,
  Grim5,
  Grim6,
  Grim7,
  Grim8,
  Grim9,
  Grim10
];

export default class Grimeton extends Component {
  render() {
    return (
      <div>
        <Pnav />
        <img className="Grimbild" src={require("./Grimeton/1.png")} />
        <img className="Grimbild" src={require("./Grimeton/2.png")} />
        <img className="Grimbild" src={require("./Grimeton/3.png")} />
        <img className="Grimbild" src={require("./Grimeton/4.png")} />
        <img className="Grimbild" src={require("./Grimeton/5.png")} />
        <img className="Grimbild" src={require("./Grimeton/6.png")} />
      </div>
    );
  }
}
